			|| CAST(CASE WHEN entry_event_ts < notification_ts AND sojlib.soj_nvl(entry_event_src_string, 'rnid') IS NOT NULL THEN '&nid=' || sojlib.soj_nvl(entry_event_src_string, 'rnid') WHEN entry_event_ts > notification_ts AND notification_ts BETWEEN start_timestamp - INTERVAL '300' SECOND AND start_timestamp + INTERVAL '90' SECOND THEN '&' || notif_src_string WHEN sojlib.soj_nvl(entry_event_src_string, 'rnid') IS NOT NULL THEN '&nid=' || sojlib.soj_nvl(entry_event_src_string, 'rnid') WHEN notification_ts BETWEEN start_timestamp - INTERVAL '300' SECOND AND start_timestamp + INTERVAL '90' SECOND THEN '&' || notif_src_string ELSE '' END AS STRING)
			/*|| CAST(CASE WHEN notification_ts BETWEEN start_timestamp - INTERVAL '300' SECOND AND start_timestamp + INTERVAL '90' SECOND THEN '&' || notif_src_string ELSE '' END AS STRING) old notification ID data */
			|| CAST(CASE WHEN sojlib.soj_nvl(entry_event_src_string, 'bk') IS NOT NULL THEN '&bk=' || TRIM(sojlib.soj_nvl(entry_event_src_string, 'bk')) ELSE '' END AS STRING)
			|| CAST(CASE WHEN lndg_page_id IN (2054849) AND sojlib.soj_get_url_path(lndg_page_url) LIKE '%/gds/%' AND sojlib.is_decimal(sojlib.soj_list_get_val_by_idx(SUBSTR(lndg_page_url , POSITION('/gds/' IN lndg_page_url)), '/', 4),18,0) = 1 THEN '&gds=' || sojlib.soj_list_get_val_by_idx(SUBSTR(lndg_page_url , POSITION('/gds/' IN lndg_page_url)), '/', 4) WHEN lndg_page_id IN (2380515) AND sojlib.soj_get_url_path(lndg_page_url) LIKE '%/edc/%' THEN '&gds=' || sojlib.soj_list_get_val_by_idx(SUBSTR(lndg_page_url , POSITION('/edc/' IN lndg_page_url)), '/', 4) ELSE '' END AS STRING)
			|| CAST(CASE WHEN lndg_page_id IN (2057253, 2057254, 2056017, 2058507) and sojlib.soj_get_url_path(lndg_page_url) LIKE '%/cln/%' THEN CASE WHEN sojlib.soj_get_url_path(lndg_page_url) LIKE ANY ('%/_edit/%','%/_create/%') THEN '' WHEN sojlib.is_decimal(sojlib.soj_list_get_val_by_idx(SUBSTR(lndg_page_url , POSITION('/cln/' IN lndg_page_url)), '/', 5),18,0) = 1 THEN '&cln=' || sojlib.soj_list_get_val_by_idx(SUBSTR(lndg_page_url , INSTR(lndg_page_url, '/cln/')), '/', 5) /*WHEN sojlib.is_decimal(sojlib.soj_list_get_val_by_idx(SOJLIB.SOJ_STR_BETWEEN(lndg_page_url, '/','?'), '/',6),18,0) = 1 THEN '&cln=' || sojlib.soj_list_get_val_by_idx(SOJLIB.SOJ_STR_BETWEEN(lndg_page_url, '/','?'), '/',6) WHEN sojlib.is_decimal(sojlib.soj_list_get_val_by_idx(SOJLIB.SOJ_STR_BETWEEN(lndg_page_url, '/','?'), '/',5),18,0) = 1 THEN '&cln=' || sojlib.soj_list_get_val_by_idx(SOJLIB.SOJ_STR_BETWEEN(lndg_page_url, '/','?'), '/',5)*/ ELSE '' END ELSE '' END AS STRING)
			|| CAST(CASE WHEN lndg_page_url LIKE '%roken2=%' THEN CASE WHEN INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7), '#')>0 THEN '&roken2=' || sojlib.soj_url_decode_escapes(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7, INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7),'#')-1), '%') WHEN INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7), '&')>0 THEN '&roken2=' || sojlib.soj_url_decode_escapes(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7, INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7),'&')-1), '%') WHEN INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7), ',')>0 THEN '&roken2=' || sojlib.soj_url_decode_escapes(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7, INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7),',')-1), '%') WHEN INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7),'?')>0 THEN '&roken2=' || sojlib.soj_url_decode_escapes(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7, INSTR(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7),'?')-1), '%') ELSE '&roken2=' || sojlib.soj_url_decode_escapes(SUBSTR(lndg_page_url, INSTR(lndg_page_url, 'roken2')+7), '%') END ELSE '' END AS STRING)
			|| CAST(CASE WHEN sojlib.soj_nvl(entry_event_src_string, 'advid') IS NOT NULL THEN '&advid=' || sojlib.soj_nvl(entry_event_src_string, 'advid') WHEN sojlib.is_decimal(sojlib.soj_nvl(sojlib.soj_get_url_params(lndg_page_url),'tracking'), 18, 0) = 1 THEN '&advid=' || sojlib.soj_nvl(sojlib.soj_get_url_params(lndg_page_url),'tracking') WHEN sojlib.is_decimal(sojlib.soj_nvl(sojlib.soj_get_url_params(lndg_page_url),'tracking'), 18, 0) = 1 THEN '&advid=' || sojlib.soj_nvl(sojlib.soj_get_url_params(lndg_page_url),'tracking') WHEN sojlib.is_decimal(sojlib.soj_nvl(sojlib.soj_get_url_params(sojlib.soj_url_decode_escapes(sojlib.soj_nvl(sojlib.soj_get_url_params(lndg_page_url),'ul_ref'), '%')),'tracking'), 18, 0) = 1 THEN '&advid=' || sojlib.soj_nvl(sojlib.soj_get_url_params(sojlib.soj_url_decode_escapes(sojlib.soj_nvl(sojlib.soj_get_url_params(lndg_page_url),'ul_ref'), '%')),'tracking') ELSE '' END AS STRING)
		AS STRING);

UPDATE t21
FROM
	p_soj_cl_t.temp_csess2a_v9 t21,
	p_soj_cl_t.temp_csess2a_v9 t22
SET
	t21.session_traffic_source_id = t22.session_traffic_source_id,
	t21.session_traffic_source_details = t22.session_traffic_source_details,
	t21.session_traffic_source_dtl2 = t22.session_traffic_source_dtl2 || '&olp=' || CAST(t22.lndg_page_id AS STRING) || '&oc=' || CAST(t22.cobrand AS STRING) || '&os=' || CAST(t22.site_id AS STRING)
WHERE
	t21.guid = t22.guid
	AND t21.session_skey = t22.session_skey
	AND t21.session_start_dt = t22.session_start_dt
	AND coalesce(t21.on_ebay_sess, 0) = 1
	AND t21.cobrand IN (6,7) /* Only override mobile (app, MWeb, TWeb, FSoM) On eBay traffic sources, since mobile crossover is a very common occurrence */
	AND t21.first_seqnum = t22.min_sc_seqnum;

UPDATE app
FROM
	p_soj_cl_t.temp_csess2a_v9 app,
	(
		SELECT
			app.guid,
			app.session_skey,
			app.site_id,
			mweb.start_timestamp,
			mweb.session_traffic_source_id,
			mweb.session_traffic_source_details,
			COALESCE(mweb.session_traffic_source_dtl2, '') || '&brguid=' || CAST(app.dlk_brguid AS STRING) || '&brsess=' || CAST(app.dlk_brsess AS STRING) || '&brlnk=' || CAST(app.dlk_mweb_link_type AS STRING) || '&link_ts_update=' || CAST(1 AS STRING) AS session_traffic_source_dtl2,
			SUM(1) OVER(PARTITION BY app.guid, app.session_skey, app.site_id ORDER BY mweb.start_timestamp ROWS Unbounded PRECEDING) AS first_rank
		FROM
			p_soj_cl_t.temp_csess2a_v9 app
			INNER JOIN p_soj_cl_t.temp_csess2a_v9 mweb
			ON app.dlk_brguid = mweb.guid AND app.dlk_brsess = mweb.session_skey AND app.start_timestamp > mweb.start_timestamp AND app.start_timestamp < mweb.end_timestamp + INTERVAL '30' MINUTE
		WHERE
			mweb.cobrand IN (6,7)
			AND COALESCE(mweb.primary_app_id,3564) = 3564
			AND app.session_traffic_source_id IN (1,2) /*organic only*/
			AND mweb.session_traffic_source_id NOT IN (1,2) /*organic only*/
			AND app.dlk_brguid IS NOT NULL
		QUALIFY first_rank = 1
	) mweb
SET
	app.session_traffic_source_id = mweb.session_traffic_source_id,
	app.session_traffic_source_details = mweb.session_traffic_source_details,
	app.session_traffic_source_dtl2 = mweb.session_traffic_source_dtl2
WHERE
	app.guid = mweb.guid AND app.session_skey = mweb.session_skey AND app.site_id = mweb.site_id;

UPDATE app1
FROM
	p_soj_cl_t.temp_csess2a_v9 app1,
	(
		SELECT
			mweb.guid,
			mweb.session_skey,
			mweb.site_id,
			app.start_timestamp,
			app.session_traffic_source_id,
			app.session_traffic_source_details,
			COALESCE(app.session_traffic_source_dtl2, '') || '&brguid=' || CAST(app.guid AS STRING) || '&brsess=' || CAST(app.session_skey AS STRING) || '&brlnk=' || CAST(app.dlk_mweb_link_type AS STRING) || '&link_ts_update=' || CAST(2 AS STRING) AS session_traffic_source_dtl2,
			SUM(1) OVER(PARTITION BY mweb.guid, mweb.session_skey, mweb.site_id ORDER BY app.start_timestamp ROWS Unbounded PRECEDING) AS first_rank
		FROM
			p_soj_cl_t.temp_csess2a_v9 app
			INNER JOIN p_soj_cl_t.temp_csess2a_v9 mweb
			ON (app.dlk_brguid = mweb.guid AND app.dlk_brsess = mweb.session_skey AND app.start_timestamp < mweb.start_timestamp AND app.start_timestamp > mweb.end_timestamp - INTERVAL '30' MINUTE)
		WHERE
			mweb.cobrand IN (6,7)
			AND COALESCE(mweb.primary_app_id,3564) = 3564
			AND mweb.session_traffic_source_id IN (1,2) /*organic only*/
			AND app.session_traffic_source_id NOT IN (1,2) /*organic only*/
			AND app.dlk_brguid IS NOT NULL
		QUALIFY first_rank = 1
	) mweb1
SET
	app1.session_traffic_source_id = mweb1.session_traffic_source_id,
	app1.session_traffic_source_details = mweb1.session_traffic_source_details,
	app1.session_traffic_source_dtl2 = mweb1.session_traffic_source_dtl2
WHERE
	app1.guid = mweb1.guid AND app1.session_skey = mweb1.session_skey AND app1.site_id = mweb1.site_id;

COMPACT TABLE p_soj_cl_t.temp_csess2a_v9;